import Avatar from '../../images/Netflix-avatar.png';

const Profile = () => {
    const dropdown = () => {
        return (
            <ul className='dropdown'>
                <li>Account Settings</li>
                <li>Log Out</li>
            </ul>
        )
    }
    return (
        <div>
            <img onClick={() => dropdown()} src={Avatar} alt='' width='50' height='50' />
        </div>

    );
}

export default Profile;
